  true,\n\t\"url\": null,\n\t\"notes\": \"The USAID Activities dataset is a snapshot
  of activities supported by USAID including their geographical locations within countries
  at the time of the snapshot. The data were used to create the map.usaid.gov web
  site on the Where We Work page. The data were used to create a map for the USAID
  web site on the Where We Work page.  Only a subset of USAID?s field offices provided
  data and many provided data on only a part of their portfolios.  Efforts are underway
  to harmonize the way data are collected by USAID missions which, when completed,
  will facilitate the display of a comprehensive portfolio of USAID activities.  The
  geographic names and boundaries in this dataset may not reflect the views of the
  United States Government on the sovereignty over geographic features.\",\n\t\"license_title\":
